import React from 'react';
import {add,sub,mult,div} from './calc';
// import Heading from './Heading';
// import Para from './Para';
// import Ol from './Ol';

// function App(){
//     return(
//     <>
//         <Heading />
//         <Para />
//         <Ol />
//         </>
//         );
    
// }
// export default App;


function App(){
    return(
        <>
        <ul>
            <li>
             The sum of two no. is{add(30, 4)}
            </li>
            <li>
             The sub of two no. is{sub(20,4)}
            </li>
            <li>
             The mult of two no. is{mult(4,8)}
            </li>
            <li>
             The div of two no. is {div(7,21)}
            </li>
        </ul>
        </>
    
    )
}
export default calc;
